puzzle = """

""".strip()

def check_marker(puzzle):
    one = puzzle[-4:-3]
    two = puzzle[-3:-2]
    three = puzzle[-2:-1]
    four = puzzle[-1:]
    if one != two and one != three and one != four:
        if two != three and two != four:
            if three != four:
                return True
    return False

for total in range(len(puzzle)):
    if total > 3:
        if check_marker(puzzle[:total]):
            print(total)
            break
        
